function ExpenseDetails({incomeAmt, expenseAmt}) {
    console.log('incomeAmt,expenseAmt ', incomeAmt,expenseAmt)

    return(
        <div>
            <div>
                Your Balance is: {expenseAmt - incomeAmt}
            </div>
           
           <div className="amounts-container">
            Income
           </div>

           <div className="amounts-container">
            Income
           </div>
           
        </div>
    )
}

export default ExpenseDetails
